// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;



contract Profile {

    struct Bio {
        string firstName;
        string lastName;

    }
    mapping (address => Bio) profile;

    function addBio() public {
        profile[msg.sender].firstName = "Tim";
        profile[msg.sender].lastName = "Tim";

    }

     function getBio() public view returns(Bio memory ) {
        return  profile[msg.sender];
    }

  
}

